import React from "react";
import FadeSlider from "./FadeSlider";

const page = () => {
  return (
    <div className=" flex">
      <div className=" bg-black w-1/2 h-[600vh] text-white text-center">
        <div className=" sticky top-[10%] left-0">
          <h1 className=" text-9xl mx-10">Create at speed of light</h1>
          <br />
          <p className=" my-5 px-11">
            focus on your getting your thoughts out and creating the best
            message while Chronicle does the heavylifting for you
          </p>
        </div>
      </div>
      <FadeSlider />
    </div>
  );
};

export default page;
